		<div>

		</div>
	);
}

class Register extends React.Component {
	constructor(props) {
		super(props);
	}
	render() {
		return (
			<div className={styles.reg_container}>
				<p>Registrarse</p>
				<div className={styles.link}>
					<p>¿Ya tenés una cuenta?</p>
					<Link to="/">Ingresa aquí</Link>
				</div>
				<form className={styles.form}>
					<input className="form-control rounded-5" type="text" placeholder="name" aria-label="default input example"></input>
					<input className="form-control rounded-5" type="text" placeholder="lastname" aria-label="default input example"></input>
					<input className="form-control rounded-5" type="email" placeholder="email" aria-label="default input example"></input>
					<input className="form-control rounded-5" type="password" placeholder="password" aria-label="default input example"></input>
					<input className="form-control rounded-5" type="password" placeholder="repeat password" aria-label="default input example"></input>
					<div className="d-grid gap-2">
							<button className="btn btn-primary rounded-5" type="button">Registrarse</button>
					</div>
				</form>
			</div>
		);
	}
}

export default Register;
